window.developerReloadIntervalMs=500;window.loadDeveloper=a=>{var b=new XMLHttpRequest();b.open('GET',`/developers/${a}/popularity`,!0);b.onload=()=>{b.status>=200&&b.status<400?document.getElementById(a).textContent=b.responseText:document.getElementById(a).textContent='Error'};b.send()};window.loadAllDevelopers=()=>{!document.hidden&&(window.loadDeveloper('bryden'),window.loadDeveloper('luke'));setTimeout(loadAllDevelopers,window.developerReloadIntervalMs)};window.voteDeveloper=(A,_)=>{var c=new XMLHttpRequest();c.open('POST',`/developers/${A}/popularity`,!0);c.setRequestHeader('Content-Type','application/json');c.onload=()=>{c.status>=200&&c.status<400?window.loadDeveloper(A):document.getElementById(A).textContent='Error'};c.send(JSON.stringify({vote:_}))};window.loadAllDevelopers();
